import ProductSale from "../components/ProductSale";
import imgOne from "../images/browitem.jpeg";
import imgTwo from "../images/browset.jpeg";

const Featured = () => {
  const items = [
    {
      key: "img01",
      src: imgOne,
      name: "Benefit Brow Gel",
      price: "$25.00",
      alt: "Brow Gel",
    },
    {
      key: "img02",
      src: imgTwo,
      name: "Benefit Brow Set",
      price: "$30.00",
      alt: "Brow Gel Set",
    },
  ];

  return (
    <section class="featured">
      <div class="featured-items">
        {items.map((a) => {
          return (
            <ProductSale
              key={a.key}
              src={a.src}
              name={a.name}
              price={a.price}
              alt={a.alt}
              class="grid-item"
            />
          );
        })}
      </div>
      <div class="featured-video">
        <iframe
          src="https://assets.pinterest.com/ext/embed.html?id=187040190766436100"
          height="714"
          width="345"
          frameborder="0"
          title="How to do your eyebrows"
          onLoad={(target) => {
            var iframe = target;
            var elmnt =
              iframe.contentWindow.querySelector("video")[0];
            elmnt.setAttribute("muted");
            elmnt.setAttribute("autoplay");
          }}
        ></iframe>
      </div>
    </section>
  );
};

export default Featured;
